css:
@-moz-document domain("minestrator.com") {
.divider {
  background: #1b1d21;
}

.bg-white {
  background-color: #1b1d21 !important;
}

body {
  color: hsl(220, 4%, 67%);
}

.border {
  border: 0px !important;
}

.m-1 {
    filter: invert(0.8);
}
.btn-outline-primary {
    margin: 5px;
    border-color: transparent;
    background-color: #1e2f2d;
}

h1, h2, h3, h4, h5, h6, .h1, .h2, .h3, .h4, .h5, .h6 {
  color: hsl(220, 24%, 93%) !important;
}

.btn-xs {
    border-color: #1b1d21 !important;
}

.bg-light {
  background-color: #212225 !important;
}

.card {
  background-color: #1b1d21;
  border: 1px solid #1b1d21;
}

.text-dark .display-1, .text-dark .display-2, .text-dark .display-3, .text-dark .display-4, .text-dark h1, .text-dark h2, .text-dark h3, .text-dark h4, .text-dark h5, .text-dark h6, .text-dark .h1, .text-dark .h2, .text-dark .h3, .text-dark .h4, .text-dark .h5, .text-dark .h6, .text-dark .blockquote {
  color: #cacaca !important;
}

h1, h2, h3, h4, h5, h6, .h1, .h2, .h3, .h4, .h5, .h6 {
  color: hsl(220, 12%, 68%);
}

.dropdown-item {
  color: hsl(220, 12%, 68%);
}

.dropdown-menu {

  background-color: #1b1d21;
  border: 1px solid #121315;
}

.border-white {
  border-color: #1b1d21 !important;
}

.bg-primary-3 {
  background-color: #212225 !important;
}

.bg-primary {
  background-color: #006046  !important;
}

.text-dark {
  color: hsl(220, 37%, 92%) !important;
}

.jarallax-img {
    filter: brightness(80%);
}

svg.bg-primary [fill]:not([fill="none"]) {
  fill: hsl(220, 5%, 68%) !important;
}
}
